//     - Descrição
//     - Valor da remuneração
//     - Método(s) de pagamento oferecidos
//     - Prazo

export default class CreateJobs extends Component {
  render() {
    return (
      <div>
        <Stack spacing={3}>
          <Input placeholder="Título*" type={"text"} />
          <Input placeholder="Descrição*" type={"text"} />
          <Input placeholder="R$" type={"text"} />
          <Select placeholder="Select option">
            <option value="option1">Cartão de Crédito</option>
            <option value="option2">Cartão de Débito</option>
            <option value="option3">Pix</option>
            <option value="option2">PayPal</option>
            <option value="option3">Boleto</option>
          </Select>
          <Input placeholder="dd/mm/yyy" />
        </Stack>
      </div>
    );
  }
}
